import React from "react";
import sprite from "../../images/sprite.svg";
import s from "./Home.module.scss";

export const Home = () => {
  return (
    <div className={s.container}>
      <img src={`${sprite}#youtube`} alt="logo" className={s.logo} />
      <p>Finance </p>
    </div>
  );
};
